import React, {Component} from 'react';
import logo from '../../images/logoV.png';
import logoStyle from './index.module.css';

class Logo extends Component {
    render() {
        return (
            <div className={logoStyle}>
                <h1>飞云办公</h1>
                <img src={logo} alt=''/>
            </div>
        );
    }
}

export default Logo;
